import React from 'react';

class Home extends React.Component {

    handleLogout = () => {
        this.props.history.push('/login');
    }

    render() {
        return (
            <div>
                Bienvenido User!<br/><br/>
                <input type="button" onClick={this.handleLogout} value="Logout"/>
            </div>
        );
    }
}

export default Home;
